import React from 'react'
import { connect } from 'react-redux'

interface ViewProps {
  username: string,
  userItems: []
}

export class UserItemsView extends React.Component <ViewProps, any> {
  constructor(props: any) {
    super(props);
    this.state = {
    }
  }

  public static defaultProps = {
    username: undefined,
    userItems: undefined
  }

  itemView: any;

  render() {
    return (
      <div className="useritemsview" ref={(ref) => { this.itemView = ref }}>
        <button id="" className="">
          Sign In
        </button>
      </div>
    )
  }
}

const mapStateToProps = ({ user: { username, userItems }}:any) => ({
  username,
  userItems,
})

export default connect(mapStateToProps)(UserItemsView)
